import styled from 'styled-components';

export const Container = styled.div`
    display: flex;
    flex-direction: column;
    width: 100%;
    position: absolute;
`

export const Card = styled.div`
    width: 50px;
    height: 50px;
    border: 1px solid red;
    margin-bottom: 50px;
`

export const Card2 = styled.div`
    width: 50px;
    height: 50px;
    border: 1px solid red;
    margin-bottom: 50px;
`
